atque aliquis posita monstrat fera proelia mensa,
 pingit et exiguo Pergama tota mero:
 'hac ibat Simois;

Dulichii Samiique et quos tulit alta Zacynthos,
 turba ruunt in me luxuriosa proci,
 inque tua regnant nullis prohibentibus aula;

sed neque Laertes, ut qui sit inutilis armis,
 hostibus in mediis regna tenere potest
 Telemacho veniet, vivat modo, fortior aetas;

frugibus infantem ramisque albentis olivae
 et levibus vittis sedula celat anus
 fictaque sacra facit dicitque precantia verba;

ut mare fit tremulum, tenui cum stringitur aura,
 ut quatitur tepido fraxina virga Noto,
 sic mea vibrari pallentia membra videres;

purpureos laniata sinus, laniata capillos
 exiguo dixi talia verba sono:
 "saevus, Hypermestra, pater est tibi;

At tu, siqua piae, Lynceu, tibi cura sororis
 quaeque tibi tribui munera, dignus habes,
 vel fer opem vel dede neci;

Forsitan et quare mea sint alterna requiras
 carmina, cum lyricis sim magis apta modis:
 flendus amor meus est;

cornua cum lunae pleno semel orbe coissent,
 litoribus nostris ancora pacta tua est
 luna quater latuit, toto quater orbe recrevit;

si tamen ille prior, quo me sine crimine gessi,
 candor ab insolita labe notandus erat,
 at bene successit, digno quod adurimur igni;

si tibi mens avida est belli, si quaerit Julus,
 unde suo partus Marte triumphus eat,
 quem superet, nequid desit praebebimus hostem;

Curribus Automedon lentisque erat aptus habenis,
 Tiphys in Haemonia puppe magister erat:
 Me Venus artificem tenero praefecit Amori;

Ut fugiunt aquilas, timidissima turba, columbae,
 Ut fugit invisos agna novella lupos:
 Sic illae timuere viros sine more ruentes;

Atque aliqua ex illis cum regum nomina quaeret,
 Quae loca, qui montes, quaeve ferantur aquae,
 Omnia responde, nec tantum siqua rogabit;

Hoc unum moneo, siquid modo creditur arti,
 Nec mea dicta rapax per mare ventus agit:
 Aut non rem temptes aut perfice;

inposito cessit harena pede:
 Implicitamque sinu (neque enim pugnare valebat)
 Abstulit;

Nec faciem, nec te pigeat laudare capillos
 Et teretes digitos exiguumque pedem:
 Delectant etiam castas praeconia formae;

Sed tibi non virgo Tegeaea comesque Bootae
 Ensiger Orion aspiciendus erit:
 Me pinnis sectare datis;

Non te Maenalias armatum scandere silvas,
 Nec jubeo collo retia ferre tuo:
 Pectora nec missis jubeo praebere sagittis;

Tum neque subjectus, solito nec blandior esto:
 Haec animi multum signa nocentis habent:
 Sed lateri ne parce tuo: pax omnis in uno est;

Quot lepores in Atho, quot apes pascuntur in Hybla,
 Caerula quot bacas Palladis arbor habet,
 Litore quot conchae, tot sunt in amore dolores;

Tum quoque, cum solem nondum prohibebat et imbrem
 Tegula, sed quercus tecta cibumque dabat,
 In nemore atque antris, non sub Jove, juncta voluptas;

Anguibus exuitur tenui cum pelle vetustas,
 Nec faciunt cervos cornua jacta senes:
 Nostra sine auxilio fugiunt bona;

Quot nova terra parit flores, cum vere tepenti
 Vitis agit gemmas pigraque fugit hiemps,
 Lana tot aut plures sucos bibit;

Est prope purpureos colles florentis Hymetti
 Fons sacer et viridi caespite mollis humus:
 Silva nemus non alta facit;
